import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as e,f as r}from"./app-3ec5641f.js";const h={},n=r('<h2 id="实习" tabindex="-1"><a class="header-anchor" href="#实习" aria-hidden="true">#</a> 实习</h2><h3 id="一、中科全安" tabindex="-1"><a class="header-anchor" href="#一、中科全安" aria-hidden="true">#</a> 一、中科全安</h3><h4 id="一面-hr面-态度算好的-5分钟" tabindex="-1"><a class="header-anchor" href="#一面-hr面-态度算好的-5分钟" aria-hidden="true">#</a> 一面：HR面，态度算好的（5分钟）</h4><p>1.介绍公司</p><p>2.问啥时候能来实习</p><p>3.问你能接受加班吗</p><p>4.问你的期望薪资多少</p><p>5.问我想听听你对加班什么看法</p><p>6.最后让明天面试，我说不行，能最晚啥时候，她说最晚周五下午，电话面试</p><h4 id="二面-面试官狗叫-15分钟" tabindex="-1"><a class="header-anchor" href="#二面-面试官狗叫-15分钟" aria-hidden="true">#</a> 二面：面试官狗叫（15分钟 ）</h4><p>面试官的态度极其恶心，什么垃圾玩意，老子是来面试的，不是听狗叫的，就算老子啥都不会也不去你这个垃圾公司。</p><p>1.自我介绍，直接打断说只介绍自己会的，项目中的技术栈</p><p>2.问我熟悉哪些框架，我说Spring、Mysql，其他都是了解，熟悉的是Java基础和Mysql，他就非得问SpringBoot，离谱</p><p>3.问Kafka的分区、主题了解吗，我就是了解，然后他也说了你只是了解</p><p>4.问ES了解吗（我只是了解他是干啥的，其它都是API）</p><p>5.问SpringBoot异常怎么处理（这个紧张忘了，只是说在一个包里要继承一个异常的接口）</p><p>6.问SpringBoot的核心配置文件以及它们的区别</p><p>7.问SpringBoot的起步依赖starter有哪些以及作用（他说你了解的很少，我都说了了解Mysql、Spring，你他妈的非得问）</p><p>8.问SpringBoot 中的监视器是什么（我说不了解）</p><p>9.问Swagger用过么、它用来做什么</p><p>10.问什么是 WebSockets（我说只了解它是用来作为即时通讯的协议）</p><p>11.问什么是 FreeMarker 模板（这个离谱，说完他是干啥的以及插值表达式，他问还有呢？他妈的）</p><p>12.问C/S 、B/S模式</p><p>13.问String、StringBuilder、StringBuffer 的区别</p><p>14.问了MySQL的存储引擎</p><p>15.问了 InnoDB 和 MyISAM 的比较</p><p>16.问了建立索引的原则</p><p>17.问了三大范式</p><p>18.问了Jdbc的防止sql注入（我说不了解）</p><p>19.反问（我说实习生的日常工作安排是什么，他妈的开始狗叫，想打他）</p><p>20.最后问我啥时能来实习（老子不去）</p><h3 id="二、联想" tabindex="-1"><a class="header-anchor" href="#二、联想" aria-hidden="true">#</a> 二、联想</h3><h4 id="一面-16分钟" tabindex="-1"><a class="header-anchor" href="#一面-16分钟" aria-hidden="true">#</a> 一面：（16分钟）</h4><p>1.说一下红黑树（吧啦吧啦，讲了下红黑树的特性、又扯到HashMap底层用到了红黑树、突然说到MySQLB+树用到了红黑树）</p><p>2.讲一下线程池（这个熟，线程池的7大参数以及具体用法）</p><p>3.讲一下为什么用线程池（两点原因）</p><p>4.讲一下线程池参数MaxSize满了你会怎么做（我说实现自定义处理策略，可以选择移除等待队列中的最不常用的线程）</p><p>5.看我熟悉Python（这里没听清发音，重复确认了好几遍哈哈哈哈哈哈哈），问我生成器用过没（我说是生成随机数吗，面试官说不是，是，还耐心给我解答了是用来循环遍历的）</p><p>5.项目拷打环节</p><p>1）讲一下你的项目经验（从项目的整体架构到具体功能实现细节都说了）</p><p>2）我说了做的一些优化（存储到阿里云OSS）</p><p>3）突然电话断了，在那我俩喂喂喂了好几声，面试官又给我打了过来，问我同步和异步怎么实现的（加@Async注解）</p><p>4）问异步调用后，做了些什么（第三方接口审核完后传来一个statusCode200，表示审核成功存储到数据库）</p><p>6.反问环节</p><p>1）实习生的日常工作安排（面试官说了早上9：30上班，下午6：30下班，八小时工作制，中午休息一小时）</p><p>2）技术栈是什么（面试官说这有Java和Python，你来就是Java）</p><h3 id="三、中国邮政储蓄银行" tabindex="-1"><a class="header-anchor" href="#三、中国邮政储蓄银行" aria-hidden="true">#</a> 三、中国邮政储蓄银行</h3><h4 id="一面-结构化面试-技术面-20分钟-五个面试官" tabindex="-1"><a class="header-anchor" href="#一面-结构化面试-技术面-20分钟-五个面试官" aria-hidden="true">#</a> 一面：结构化面试+技术面（20分钟，五个面试官）</h4><p>1.先做一个两分钟以内的自我介绍（对邮储的看法，对未来工作的看法）</p><p>2.对工作地点的看法</p><p>3.有没有参加过团体活动</p><p>4.数学建模比赛中遇到的最大困难</p><p>5.开始技术面试了，面试官说看你简历都是Java相关，讲一下Spring Cloud你用过的组件</p><p>6.ConcurrentHashMap为什么用红黑树</p><p>7.看你项目中用到了网关，是怎么实现的</p><p>8.都说CAS要比synchronized好，但是CAS也有自己的问题，你能说一下有哪些问题吗</p><p>9.另一个面试官问看你简历有高并发系统的东西，你有实际的项目经验吗（这个我说就是了解，实际项目是自学的，实际项目经验都是人工智能相关的）</p><p>10.最后女的HR问看你成绩这么好，没有保研吗</p><p>11.讲一下研究生的论文成果</p><p>12.研究生的专业成绩排名，有获得过奖学金吗</p><p>13.最后问有offer吗，方便说一下是哪个公司吗</p><p>另：</p><p>1.对工作地点的看法</p><p>2.CPU达到100%的时候你如何排查问题</p><p>3.新生代和老年代数据是如何流动的</p><p>4.Linux如何给文件权限</p><p>5.想从实习中收获什么</p><p>6.看你是院研副部长，如果负责的活动和实验室科研冲突了怎么平衡</p><p>7.你平常也这样扎头发吗</p><h2 id="秋招" tabindex="-1"><a class="header-anchor" href="#秋招" aria-hidden="true">#</a> 秋招</h2><h3 id="一、海尔-提前批一面11min-经理技术面-hr面-挂" tabindex="-1"><a class="header-anchor" href="#一、海尔-提前批一面11min-经理技术面-hr面-挂" aria-hidden="true">#</a> 一、海尔（提前批一面11min：经理技术面+HR面）：挂</h3><p>1.自我介绍</p><p>2.就关于应聘的软件开发岗位谈一下实际的开发</p><p>3.对于取得的最终效果讲一下</p><p>4.看了你去年做了一个博客社区的项目（？？？去年，博客社区？这个经理不太专业呀），你是用MD5做的，那么MD5它能够被破解吗（我说算力够的话能够被破解，对面不满意？？？）</p><p>5.那你熟悉这个加密算法吗？它属于对称加密还是非对称加密（凉了，直接说不熟悉）</p><p>6.我看到你用到了ThreadLocal，那你能简单说下ThreadLocal的原理吗？</p><p>7.那你什么时间把这个对象删除的呢？我看你为了防止内存泄漏，那你怎么判断它使用完了呢？</p><p>8.Token失效谁判断的？</p><p>9.说我python写得多，而他们用Java比较多，所以问我一个逻辑题：甲乙两个人，有2-6五张牌，甲乙各抽一张，你怎么判断谁大谁小？（离谱，我简历上都是Java，这是不想要我刷KPI呢）</p>',80),i=[n];function d(t,o){return a(),e("div",null,i)}const l=p(h,[["render",d],["__file","面试.html.vue"]]);export{l as default};
